import React, { useState } from "react";

const Welcome = (props) => {
  const startGameHandler = (props) => {
    props.setCurrentPage(true);
  };

  return (
    <div>
      <h1>Welcome to our Draw And Guess game!</h1>
      <button onClick={startGameHandler}>Click to start</button>
    </div>
  );
};

export default Welcome;
